css:
@-moz-document domain("deviantart.com") {
#deviant{
  background-color:#EAF2EE !important;
  background-image:none !important;
  border-top:70px solid #D5E3DF !important;
  color:#2C3635 !important;
}
body.deviant div#activity-container{
 background-color:#EAF2EE !important;
}
#deviant .deviant{
  margin-top:-65px !important;
}

body.deviant #deviant div.box, 
body.deviant #deviant div.comments div.thought, 
body.deviant #deviant div.comments div.nav span.shadow span, 
body.deviant div.pollpole{
  border-color:#D3E0DC !important;
}
body.deviant div.box div.boxtop{
  background-color:#D3E0DC !important;
}

body.deviant div.collapsed-thought{
  background-color:#D3E0DC !important;
}
body.deviant ul.list li.a, 
body.deviant #deviant div.altview, 
tr.a td,
.mglist li.odd{
  background-color:#E5EDEA !important;
}
body.deviant #deviant a.replybutton, 
body.deviant #deviant a.moodbutton 
{
 background-image:url(http://st.deviantart.com/styles/minimal/minish/hubblebuttons.gif) !important;
}
body.deviant #deviant div i.tl, 
body.deviant #deviant div i.tr, 
body.deviant #deviant div i.bl, 
body.deviant #deviant div i.br{    background-image:url(http://sh.deviantart.com/shadow/EAF2EE-EAF2EE/0-1/1/1/null.png) !important;
  border-color:#EAF2EE !important;
}
div.iconset-deviant-boxtop i, div.boxtop i.icon {  background-image:url(http://s.deviantart.com/staff/mindfuckx/sexypage/icons-deviant-boxtop.gif) !important;
}
div.iconset-deviant-tab i{  background-image:url(http://s.deviantart.com/staff/mindfuckx/sexypage/icons-deviant-tabd.gif) !important;
}
body.deviant #deviant div.supernav div.floating-highlight{
  background-color:#EAF2EE !important;
  border-color:#EAF2EE  !important;  
}
div.iconset-deviant-tab i.super {   background-image:url(http://s.deviantart.com/staff/mindfuckx/sexypage/icons-deviant-tab.gif) !important;
}
body.deviant #deviant div.supernav i.tl, 
body.deviant #deviant div.supernav i.tr, 
body.deviant #deviant div.supernav i.bl, 
body.deviant #deviant div.supernav i.br {  background-image:url(http://sh.deviantart.com/shadow/D5E3DF-D5E3DF/0-1/1/1/null.png) !important;
  border-color:#D5E3DF !important;
}
#deviant #deviant-commands,
#deviant #deviant-stats{
  background-color:#EAF2EE !important;
  border-color:#EAF2EE !important;
}
#deviant #deviant-commands.self i.ff,
#deviant #deviant-stats #faderingthing{   background-image:url(http://s.deviantart.com/staff/mindfuckx/sexypage/deviant-fade.png)!important;
}
td.gsmaster{
  background-color:#D5E3DF !important;
}
ul.headlines span.lovi{  background-image:url(http://s.deviantart.com/staff/mindfuckx/sexypage/loveri.gif)!important;
}
body.deviant div.deviousthought div.moodarea td{
border:1px solid #9DB1B0 !important;
}
body.deviant div.deviousthought #commentbody{
border:1px solid #D3E0DC!important;
}
body.deviant div.deviousthought div.browser,
div.pager-deviant, 
div.pager-deviant div.pager2, 
div.pager-deviant div.page2, 
div.pager-deviant div.page2 a.f{
background:#DEE8E5 !important;
}
div.pager-deviant div.page2 a:hover{
background:#CED8D5!important;
}
div.pager-deviant div.page2 a.highlight{
background:#DAE1DF !important;
}
.mglist .main{
padding:5px !important;
}
.mglist .main img{
display:none !important;
}
}
